        let MyWorks
        if (this.state.works.length > 0) {
            MyWorks = this.state.works.map(i => {
                return <li className={classes.Work}>
                    <div className={classes.TopWorkHeader}>
                        <div className={classes.RemoveWork} onClick={this.cancelDelete}>
