                            <i class="fas fa-hospital-user">:</i>
                            <font className={classes.UsersGroupValue}>5</font>
                        </div>
                    </div>
                    <div
                        className={this.state.delete ? [classes.active, classes.DeleteContainer].join(" ") : classes.DeleteContainer}>
                        <div className={classes.container}>
                            <h1>Delete Work</h1>
                            <p>Are you sure you want to delete your work?</p>
                            <div className={classes.clearfix}>
                                <button
                                    type="button"
                                    onClick={this.cancelDelete}
                                    className={classes.cancelbtn}
                                >Cancel</button>
                                <button
                                    type="button"
                                    onClick={this.cancelDelete}
                                    className={classes.deletebtn}
                                >Delete</button>
                            </div>
                        </div>
                    </div>
                </li>
            })
        } else {
            MyWorks = <div>bbbbbbbbbb</div>
        }

        return MyWorks
    };

